PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "employs" ("id" integer primary key autoincrement not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "clients" ("id" integer primary key autoincrement not null, "full_name" varchar not null, "email" varchar not null, "phone" varchar, "address" varchar, "city" varchar, "state" varchar, "postal_code" varchar, "country" varchar, "birth_date" date, "identification_number" varchar, "gender" varchar check ("gender" in ('male', 'female', 'other')), "notes" text, "registration_date" date, "status" varchar check ("status" in ('active', 'inactive')) not null default 'active', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "products" ("id" integer primary key autoincrement not null, "nameProduct" varchar not null, "description" text, "price" numeric not null, "costo_produccion" numeric not null, "costoProduccionExtra" numeric, "costoExterno" numeric, "status" varchar check ("status" in ('Activo', 'Inactivo')) not null default 'Activo', "category_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("category_id") references "categories"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "categories" ("id" integer primary key autoincrement not null, "created_at" datetime, "updated_at" datetime, "nameCategory" varchar not null, "description" text, "status" varchar check ("status" in ('active', 'inactive')) not null default 'active');
CREATE TABLE IF NOT EXISTS "pedidos" ("id" integer primary key autoincrement not null, "factura" varchar, "fechaEntrega" varchar, "envioDomicilio" tinyint(1) not null default '0', "clientId" integer not null, "estado" varchar check ("estado" in ('Pedido creado', 'Pedido enviado', 'Pedido recibido', 'Pedido confirmado', 'Materiales en stock', 'Produccin en curso', 'Control de calidad', 'Empaquetado', 'Enviado', 'Entregado', 'Pedido completado', 'Cancelado')) not null default 'Pedido creado', "impreso" tinyint(1) not null default '0', "notas" text, "created_at" datetime, "updated_at" datetime, foreign key("clientId") references "clients"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "orders" ("id" integer primary key autoincrement not null, "categoriaId" integer not null, "pedidoId" integer not null, "producto" varchar not null, "descripcion" text not null, "talla" varchar not null, "cantidad" varchar not null, "facultad" varchar not null, "precioUnitario" varchar not null, "estado" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("categoriaId") references "categories"("id") on delete cascade, foreign key("pedidoId") references "pedidos"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "empleados" ("id" integer primary key autoincrement not null, "nombreCompleto" varchar not null, "fechaNacimiento" date not null, "genero" varchar not null, "dni" varchar not null, "direccion" varchar not null, "telefono" varchar not null, "email" varchar not null, "fechaContratacion" date not null, "cargo" varchar not null, "salario" varchar not null, "fotografia" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "produccions" ("id" integer primary key autoincrement not null, "pedido_id" integer not null, "estado" varchar check ("estado" in ('procesado', 'sin procesar', 'cancelado')) not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "asignacions" ("id" integer primary key autoincrement not null, "empleado_id" integer not null, "order_id" integer not null, "cantidad" integer not null, "fecha_asignacion" date not null, "costo" numeric not null, "tipocosto" varchar not null, "estado" varchar check ("estado" in ('asignado', 'terminado')) not null default 'asignado', "created_at" datetime, "updated_at" datetime, foreign key("empleado_id") references "empleados"("id") on delete cascade, foreign key("order_id") references "orders"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "cobros" ("id" integer primary key autoincrement not null, "created_at" datetime, "updated_at" datetime, "order_id" integer not null, "monto" numeric not null, "fechacobro" date not null, "fechavencimiento" date not null, "estado" varchar check ("estado" in ('pendiente', 'pagado', 'vencido')) not null default 'pendiente', foreign key("order_id") references "order"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "product_images" ("id" integer primary key autoincrement not null, "product_id" integer not null, "image_path" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("product_id") references "products"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "historial_impresions" ("id" integer primary key autoincrement not null, "pedido_id" integer not null, "fecha_impresion" datetime not null, "usuario" varchar not null, "tipo_impresion" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("pedido_id") references "pedidos"("id") on delete cascade);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE UNIQUE INDEX "clients_email_unique" on "clients" ("email");
CREATE UNIQUE INDEX "products_nameproduct_unique" on "products" ("nameProduct");
CREATE UNIQUE INDEX "categories_namecategory_unique" on "categories" ("nameCategory");
CREATE UNIQUE INDEX "empleados_dni_unique" on "empleados" ("dni");
CREATE UNIQUE INDEX "empleados_email_unique" on "empleados" ("email");
COMMIT;
